import React from 'react';
import './Login.css';
function Login() {
  return (
    <div className="wrapper">
        <div className="container wrapper-box">
        <input
            type="text"
            value={handelText}
            placeholder=""
            autoComplete="off"
            onChange={(e) => setHandelText(e.target.value)}
          />
        </div>
    </div>
  )
}

export default Login
